import mainImage from '../images/logo.png'

function Logo() {

    return (
        <div style={{height: 'calc(var(--navigation-bar-height) - 10px)',
                fontSize: 'calc((var(--navigation-bar-height) - 10px))',
                display: 'flex',
                flexDirection: 'row',
                alignItems: 'center'}}>
            COMAN
            <img src={mainImage} style={{height: 'calc(var(--navigation-bar-height) - 10px)'}}/>
            PP
        </div>
    )

}

export default Logo;
